description:
The Register of Third-Party Lobbyists is a public document that contains the following information in respect of each registered third-party lobbyist:
The name and business contact details of the lobbyist
The names of the individuals engaged to undertake the lobbying of Government officials for the lobbyist (“employees”);
The names of the persons having a management or financial interest in the lobbyist (“owners”);
The names of the third parties who have retained the lobbyist to provide, or for whom the lobbyist has provided, paid or unpaid lobbying services (“clients”); and
The ABN of each client, where the client has one.
